from copy import copy
import numpy as np;

verb=False
DEBUG_MODE=False


def v_to_integer(arr):
    output=np.zeros(shape=arr.shape[1], dtype=np.uint64)
    assert len(arr)<=64
    for i in range(len(arr)):
        ind=len(arr)-i-1
        output+=arr[i]*(2**ind)
    return output



def v_select_word(input, bits):
    """
    - input is a ndarray
    - bits is the array representing the bits to extract
    - input_size is the size (in bits) of the input word
    """
    if bits == list(range(len(input))):
        output = input
    else:
        output = input[bits]
    if verb:
        print(f'select_word input : {input.transpose()}')
        print(f'select_word bits : {bits}')
        print(f'select_word output : {output.transpose()}')
        print("---")
    return output


def v_SBOX(input, sbox):
    """
      - input is a input_size * number_of_inputs binary ndarray
      - sbox is a ndarray representing the SBox
      """
    tmp = np.zeros(shape=(8, input.shape[1]), dtype=np.uint8)
    tmp[-input.shape[0]:] = input
    int_val = np.packbits(tmp, axis=0)
    int_output = sbox[int_val]
    output = np.unpackbits(int_output, axis=0)
    if verb:
        print("SBox")
        print("Input : ", input.transpose());
        print("Int input : ", int_val.transpose());
        print("Int output : ", int_output.transpose());
        print("Output : ", output.transpose());
        print("---")
    return output[-input.shape[0]:]


def v_XOR(input, number_of_inputs, output_bit_size):
    """
    - input is a list of ndarray
    - number_of_inputs is an integer representing the number of values to be xored together
    - input_number_of_words is an integer representing the number of words of each input to the XOR
    """
    output = 0  # copy(inputConcatenated[0:output_bit_size])
    if number_of_inputs==len(input):
        for i in range(number_of_inputs):
            output = output + input[i]
    else:
        inputConcatenated = v_CONCAT(input)
        for i in range(number_of_inputs):
            output += inputConcatenated[i * output_bit_size:(i + 1) * output_bit_size]
    output&=1

    if DEBUG_MODE:
        intInputs=[v_to_integer(inputConcatenated[i * output_bit_size:(i + 1) * output_bit_size]) for i in range(len(inputConcatenated))]
        X=0
        for i in range(len(inputConcatenated)):
           X^=intInputs[i]
        assert np.all(X==v_to_integer(output))

    if verb:
        print("XOR:")
        print([input[i].transpose() for i in range(len(input))])
        print(" Output:")
        print(output.transpose())
        print("---")

    return output


def v_CONCAT(input):
    """
    - input is a list of ndarray
    """
    #numCols = [input[i].shape[1] for i in range(len(input))]
    #maxCols = np.max(numCols)
    #inputNormalized = copy(input)
    #for i in range(len(inputNormalized)):
    #    if inputNormalized[i].shape[1] != maxCols:
    #        inputNormalized[i] = np.broadcast_to(inputNormalized[i], (inputNormalized[i].shape[0], maxCols))
    #output = np.vstack(inputNormalized)
    if len(input)==1:
        return input[0]
    numCols = [input[i].shape[1] for i in range(len(input))]
    numRows=  [input[i].shape[0] for i in range(len(input))]
    totalRows = np.sum(numRows)
    maxCols = np.max(numCols)
    output = np.empty(shape=(totalRows, maxCols), dtype=np.uint8)
    pos=0
    for i in range(len(input)):
        cols=input[i].shape[1]
        rows=input[i].shape[0]
        if input[i].shape[1] != maxCols:
            output[pos:pos+rows]=np.broadcast_to(input[i], (rows, maxCols))
        else:
            output[pos:pos+rows]=input[i]
        pos+=rows


    #    if verb:
    #        print("CONCAT:")
    #        print([input[i].transpose() for i in range(len(input))])
    #        print(" Output:")
    #        print(output.transpose())
    #        print("---")
    return output


def v_AND(input, number_of_inputs, output_bit_size):
    """
    - input is a list of ndarray
    - number_of_inputs is an integer representing the number of values to be ANDed together
    - output_bit_size is an integer representing the bit size of the output
    """
    output = 1  # copy(inputConcatenated[0:output_bit_size])
    if number_of_inputs==len(input):
        for i in range(number_of_inputs):
            output = output & input[i]
    else:
        inputConcatenated = v_CONCAT(input)
        for i in range(number_of_inputs):
            output = output & inputConcatenated[i * output_bit_size:(i + 1) * output_bit_size]
    if verb:
        print("AND:")
        print([input[i].transpose() for i in range(len(input))])
        print([inputConcatenated[i].transpose() for i in range(len(inputConcatenated))])
        print(" Output:")
        print(output.transpose())
    return output


